import React from 'react'
import { Col, Input, Form} from 'antd';




class TextFieldComp extends React.Component {
    render() {
        const {myProp} = this.props;


        return (
            <Col span = {4}>
                <Form.Item
                    name = {this.props.name}
                    label = {this.props.label}>
                    <Input/>
                </Form.Item>

            </Col>
        )
    }
}

export default TextFieldComp
